import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const sendData = async () => {
  const data = { name: 'Pushups', value: 20 };
  await fetch('http://localhost:5000/api/tests', {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify(data),
  });
};

const handleConfirm = async () => {
  // ...existing code for updating state...

  // Send to backend
  try {
    await fetch('http://localhost:5000/add-test', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name: 'Your data here' }), // Replace with your actual data
    });
  } catch (err) {
    console.error('Failed to send data to backend', err);
  }
};
